let videos = [
  {
    title: "First Video",
    rating: 5,
    Comments: 2,
    createdAt: "2 minutes ago",
    views: 1,
    id: 1,
  },
  {
    title: "Second Video",
    rating: 5,
    Comments: 2,
    createdAt: "2 minutes ago",
    views: 50,
    id: 2,
  },
  {
    title: "Third Video",
    rating: 5,
    Comments: 2,
    createdAt: "2 minutes ago",
    views: 50,
    id: 3,
  }
];
export const trending = (req, res) => {
  return res.render("home", { pageTitle: "Home", videos });
};
